import React, { Component } from 'react';
import ask from './ask.jpg';
import send from './send.jpg';


class AskSend extends Component {
  render() {
    return (
      <div>
      <div className="askSendContainer container">
      <img src ={ask} className="askSendPic" alt="Ask for Healing"></img>
        <h1 className="askSendText">Ask For Healing</h1>
      </div>  
      <div>
        <img src={send} className="askSendPic"></img>
        <h1 className="askSendText" alt="Send Love">Send Healing</h1>
      </div>
      </div>
    )
  }
};

export default AskSend;
